 ('108', '108', 'en_us', 'Staff Profile Index', NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, 'Our students are passionate about design.', '<p>Our student employees come from backgrounds of all shapes and sizes, bringing with them a fresh and versatile approach that inspires our designs. With backgrounds in Visual Communication Design, Public Relations, User Experience, Advertising, Computer Information Systmes, Digital Sciences, Marketing and Communications, our diverse team members have one thing in common, they\'re passionate about design.</p>', 'Work for IdeaBase', 'We empower our student employees to imagine, create and deliver quality designs while gaining real-world experience on client-facing projects. Our studen employees get to put their design skills to the test, build their resumes and jumpstart their careers.', NULL, NULL, NULL, NULL, 'Committed to quality.', '<p>We’re committed to delivering quality work to our clients. That’s why our student employees work under the guidance of our professional staff from Kent State’s College of Communication of Information and a professional advisory board. Our student employees interact directly with clients, developing proposals, managing projects and handling all stages of design production.</p>', 'Learn more about working for IdeaBase.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-10-06 14:08:01', '2015-12-14 21:22:20', '2678f2c6-9572-4609-b1de-6434f12b3901'),
 ('109', '109', 'en_us', 'Process Index', NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Our design process is tailored to you.', 'This is a Link', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'This is a process Description', '<p>We can test the performance and usability of your product on various devices in our User Experience Testing Lab. This is a great resource to ensure that your product translates across all platforms.</p>', 'IDEABASE WAS INEXPENSIVE AND HELPED INCREASE VISITORS TO OUR BUSINESS. THAT\'S A WIN-WIN IF YOU ASK ME!', 'Chris Hallahan, IdeaBase', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'More about our UX Testing Lab', 'Sounds great, How much does it cost?', '<p>This is a test</p>', NULL, NULL, NULL, NULL, '2015-10-06 14:37:07', '2015-12-14 20:35:53', '72d8ae98-81e1-446a-b75f-f17b51ddaf18'),
