 ('119', '119', 'en_us', 'Kristin Dowling', NULL, 'Business Development Manager', 'kdowling@ideabasekent.com', '330.672.7366', '<p>Kristin is the Business Development Manager for IdeaBase (formerly The Tannery). She is responsible for building client relationships in order to provide high quality experiential learning opportunities for our students.</p>\r\n\r\n<p>She previously served as an Entrepreneur-in-Residence for the Center for Entrepreneurship and Business Innovation in the Kent State University College of Business. Her experience prior to coming to Kent State University was as Regional Operations Manager for Kinko’s Inc. (now known as FedEx Office).</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Dowling', '', '2015-10-22 17:54:18', '2015-12-17 17:43:06', '58c7308e-b356-41df-84bf-46893aab490e'),
 ('120', '120', 'en_us', 'Christopher Hallahan', NULL, 'User Experience Designer', 'challahan@ideabasekent.com', '330.672.3031', '<p>Chris is a full-time user experience designer for<a href=\"http://ideabasekent.com/\"> <u>IdeaBase</u></a> and<a href=\"http://www.kent.edu/cci\"> <u>Kent State University’s College of Communication and Information</u></a>. He manages research and interactive/web projects at IdeaBase, and works one-on-one with IdeaBase students to teach them web design, user experience and content management techniques.</p>\r\n\r\n<p>His passions include responsive web design, usability, information architecture and content management system design (especially WordPress).  In addition to his work at IdeaBase, he teaches courses in Digital Sciences and Responsive Web Design.</p><br><br>He is a graduate of Kent State, with a bachelor’s degree in Electronic Media and master’s degree in User Experience Design. He lives in Kent, OH.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-10-22 17:54:56', '2015-12-17 16:17:06', 'fee80180-381d-42c9-8d2e-af3c2bf31c72'),
