 ('129', '131', 'en_us', 'Being a Creative: Rachel Kozy', NULL, NULL, NULL, '0', NULL, NULL, NULL, '<p>Hi! My name is Rachel Kozy and I am a senior Visual Communication Design major. I actually just started working as a designer at IdeaBase a couple months ago, but I will be here for the rest of the year! Even when I was a freshman in VCD, I had always heard about Glyphix and IdeaBase, but I never knew if I’d get the opportunity to work here. When I became a junior though, I started noticing all the work IdeaBase was putting out, and it made me really interested in being a part of it!</p><p>Before IdeaBase, I had interned at MTV in New York City and Go Media in Cleveland. I’ve also worked as a designer for Kent State University Libraries and I’m currently working as the Art Director for Brainchild and the president of Kent’s collegiate chapter of AIGA.</p><p>Working at IdeaBase is seriously the best. I love working here. It has such a great environment and I get to collaborate with the friendliest, nicest people, do work that I’m passionate about, and get paid!</p><p>I chose to major in Visual Communication Design because I was really interested in creating things while in high school. I’ve always loved scrapbooking and working on the computer, so graphic design just seemed like the perfect fit. And luckily, it has been! There hasn’t been one day that has passed where I’ve regretted choosing this as my major, and I’m looking forward to continuing my career doing something I love.</p><p>The hardest part of my major is probably just making sure not to get burnt out. It’s easy to be overly ambitious and want to work on everything all the time, but that eventually wears you down and you stop looking forward to it. It’s important to take breaks and find other interests, that way you can always look forward to designing rather than it being a chore.</p><p>When I’m not busy with work or design, you can probably find me playing video games. I grew up with a brother who constantly played, so I’ve developed a habit of it too. My favorite genre is JRPGS, and my favorite games specifically are Persona 4 and the Tales series.</p><p>After I graduate, I’m not entirely sure where I’ll end up, but I’d love to find a position at a design firm or advertising agency! I really want to work with a lot of different clients and brands and I think that’s my best bet for that kind of work.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-11-05 15:00:59', '2015-11-05 15:00:59', 'eb8ad4f2-59c5-46e5-8675-3e5a3d13a916'),
 ('130', '132', 'en_us', 'Event Planning 101: Victoria Ripepi', NULL, NULL, NULL, '0', NULL, NULL, NULL, '<p>Hello, my name is Victoria Ripepi. I am an Interpersonal Communications major who is currently on my 5th year victory lap, but I am set to graduate in May 2016. I am the new event coordinator at IdeaBase.</p>\r\n\r\n<p>As long as I can remember, event planning has been an interest of mine. The first event I planned was in 3rd grade when my teacher asked me to help with a parent-teacher-open house. As a 3rd grader, I basically thought I was the coolest person in the world&hellip; even though all I really did was set out some flyers, cookies, and juice. But I have enjoyed event planning ever since!</p>\r\n\r\n\r\n\r\n<p>I think I enjoy event planning because I am so organized, I like to fix problems, I work best under pressure, and I like the exciting/nervous feeling you get on the day of the event. A lot of times when I say I want to go into event planning after I graduate people automatically think I mean weddings, but that is not the case. I want to do open houses, launch parties, special-event parties and so on.</p>\r\n\r\n\r\n\r\n<p>Before working at IdeaBase, I interned in the Spring of 2015 for an awesome company called Rebecca Adele PR & Events. I learned so much about myself and event planning there. One major thing I learned was that I didn’t want to go into PR after I graduate (the other career path I considered) and event planning is really what I love and have a passion for.</p>\r\n\r\n\r\n\r\n<p>The owner, Becki, puts on over 10 art shows called the Avant-Garde Art & Craft Shows all throughout Northeast Ohio. There were over 100 vendors at each event and I helped personally put on 4 shows. I also helped in the launch of a new show line called Bump to Bows- A Mommy Boutique Show.</p>\r\n\r\n\r\n\r\n<p>When it comes to IdeaBase, I actually heard about the agency through one of the managers, Kristin, who is a longtime-family friend. When she told me about IdeaBase it immediately sparked my interest, and when the opportunity for an event coordinator came up, I jumped at it. I really enjoy working here and have already learned so much! IdeaBase is such a fun, encouraging, and helpful work environment. Being new here, whenever I have a question or concern, they immediately do whatever possible to help me. I have also learned so much about what it means working at a design agency and how talented my co-workers are!</p>\r\n\r\n\r\n\r\n<p>As for my personal life, in my free time you can probably find me outside (if it’s nice out), at a mall because I have a deep love for clothes and fashion or hanging out with my two cats. I travel at any opportunity I can; I hope to travel to all 50 states one day!</p>\r\n\r\n\r\n\r\n<p>After graduation I hope to get a job out of state. I am Cleveland born and raised and Ohio will always be home, but I know I need to get out of here and explore more than just my bubble that is Ohio. I like to push myself to always try new things and take opportunities that push me outside my comfort zone because that’ll only make my comfort zone that much bigger.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-11-05 15:05:05', '2015-12-17 15:58:59', '61e594fe-41c0-4c20-b28d-b276db539c73'),
