 ('146', '148', 'en_us', 'Projects Homepage', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Tried-and-true', '<p>Our award-winning process delivers quality design solutions that transform our clients\' products.</p>', 'How we\'re making a difference.', '<p>We make a positive impact on your design, and our student designers.</p>', 'Helping our students succeed.', '<p>At IdeaBase, we want our student employees to succeed. Thats\'s why we partner with Glyphix to teach the next generation through studio experiences. Our students develop and exercise project-based skills in marketing, design, research and more. Additionally, our Responsive Web Design class ensures the next generation of designers and developers understand how to create highly functional and usable websites.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'More Projects', 'Learn about our transformative classroom experiences.', NULL, NULL, '2015-11-06 14:19:01', '2015-12-14 20:37:30', 'e5562858-4fff-475b-9085-3dafe2c3b224'),
