ally heard about the agency through one of the managers, Kristin, who is a longtime-family friend. When she told me about IdeaBase it immediately sparked my interest, and when the opportunity for an event coordinator came up, I jumped at it. I really enjoy working here and have already learned so much! IdeaBase is such a fun, encouraging, and helpful work environment. Being new here, whenever I have a question or concern, they immediately do whatever possible to help me. I have also learned so much about what it means working at a design agency and how talented my co-workers are!<\\/p><p>As for my personal life, in my free time you can probably find me outside (if it\\u2019s nice out), at a mall because I have a deep love for clothes and fashion or hanging out with my two cats. I travel at any opportunity I can; I hope to travel to all 50 states one day!<\\/p><p>After graduation I hope to get a job out of state. I am Cleveland born and raised and Ohio will always be home, but I know I need to get out of here and explore more than just my bubble that is Ohio. I like to push myself to always try new things and take opportunities that push me outside my comfort zone because that\\u2019ll only make my comfort zone that much bigger.<\\/p>\",\"92\":[\"114\"],\"49\":\"\"}}', '2015-11-25 21:55:43', '2015-11-25 21:55:43', 'be509c48-a940-4da7-b8d1-09d1c7bdff68'),
