 ('136', '108', '11', '87', 'en_us', '6', '', '{\"typeId\":\"11\",\"authorId\":null,\"title\":\"Staff Profile Index\",\"slug\":\"staff-profile-index\",\"postDate\":1445610228,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"172\"],\"39\":\"<p>Our student employees come from backgrounds of all shapes and sizes, bringing with them a fresh and versatile approach that inspires our designs. With backgrounds in Visual Communication Design, Public Relations, User Experience, Advertising, Computer Information Systmes, Digital Sciences, Marketing and Communications, our diverse team members have one thing in common, they\'re passionate about design.<\\/p>\",\"38\":\"Our students are passionate about design.\",\"45\":[\"111\"],\"57\":\"<p>We\\u2019re committed to delivering quality work to our clients. That\\u2019s why our student employees work under the guidance of our professional staff from Kent State\\u2019s College of Communication of Information and a professional advisory board. Our student employees interact directly with clients, developing proposals, managing projects and handling all stages of design production.<\\/p>\",\"56\":\"Committed to quality.\",\"41\":\"<p>We empower our student employees to imagine, create and deliver quality designs whil gaining real-world experience on client-facing projects. Our studen employees get to put their design skills to the test, build their resumes and jumpstart their careers.<\\/p>\",\"58\":\"<p>Learn more about <a href=\\\"http:\\/\\/www.google.com\\\">working for IdeaBase.<\\/a><\\/p>\",\"40\":\"Work for IdeaBase\"}}', '2015-12-14 20:37:38', '2015-12-14 20:37:38', 'effa7e02-b3bd-4168-bf5d-a37c5f5518bc'),
