 ('138', '2', '1', '87', 'en_us', '9', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"IdeaBase Kent New Website\",\"slug\":\"homepage\",\"postDate\":1442581332,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"37\":[\"172\"],\"36\":\"We\'re a Kent State student-powered design agency located in downtown Kent, Ohio. Our team represents a variety of backgrounds and disciplines, united in our passion for creating meaningful solutions for our clients.\",\"113\":[\"174\"],\"66\":\"Our design process is tailored to you.\",\"35\":\"Research-based, student-powered design solutions.\",\"68\":\"<p>Our processes deliver results. No matter the industry or design challenge, our past work speaks for itself.<\\/p>\",\"67\":\"Tried-and-True\"}}', '2015-12-15 17:42:13', '2015-12-15 17:42:13', 'c26114a8-7572-47c0-ae50-45b21a4f5024'),
