 ('141', '119', '3', '87', 'en_us', '5', '', '{\"typeId\":\"3\",\"authorId\":\"87\",\"title\":\"Kristin Dowling\",\"slug\":\"kristin-dowling\",\"postDate\":1445536440,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"6\":\"<p>Kristin is the Business Development Manager for IdeaBase (formerly The Tannery). She is responsible for building client relationships in order to provide high quality experiential learning opportunities for our students.<\\/p>\\r\\n\\r\\n<p>She previously served as an Entrepreneur-in-Residence for the Center for Entrepreneurship and Business Innovation in the Kent State University College of Business. Her experience prior to coming to Kent State University was as Regional Operations Manager for Kinko\\u2019s Inc. (now known as FedEx Office).<\\/p>\",\"77\":\"\",\"4\":\"kdowling@ideabasekent.com\",\"7\":\"\",\"26\":[\"5\"],\"3\":\"Business Development Manager\",\"5\":\"330.672.7366\",\"27\":[\"178\"],\"89\":\"\"}}', '2015-12-15 20:36:53', '2015-12-15 20:36:53', 'ebf93728-6782-4a92-92c6-a0e2240caf63'),
 ('142', '120', '3', '87', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"87\",\"title\":\"Christopher Hallahan\",\"slug\":\"christopher-hallahan\",\"postDate\":1445536440,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"6\":\"<p>Chris is a full-time user experience designer for<a href=\\\"http:\\/\\/ideabasekent.com\\/\\\"> <u>IdeaBase<\\/u><\\/a> and<a href=\\\"http:\\/\\/www.kent.edu\\/cci\\\"> <u>Kent State University\\u2019s College of Communication and Information<\\/u><\\/a>. He manages research and interactive\\/web projects at IdeaBase, and works one-on-one with IdeaBase students to teach them web design, user experience and content management techniques.<\\/p>\\r\\n\\r\\n<p>His passions include responsive web design, usability, information architecture and content management system design (especially WordPress).  In addition to his work at IdeaBase, he teaches courses in Digital Sciences and Responsive Web Design.<\\/p><br><br>He is a graduate of Kent State, with a bachelor\\u2019s degree in Electronic Media and master\\u2019s degree in User Experience Design. He lives in Kent, OH.\",\"77\":\"\",\"4\":\"challahan@ideabasekent.com\",\"7\":\"\",\"26\":[\"5\"],\"3\":\"User Experience Designer\",\"5\":\"330.672.3031\",\"27\":[\"178\"],\"89\":\"\"}}', '2015-12-15 20:37:01', '2015-12-15 20:37:01', '97b2c309-5eac-43fe-b2e3-97dffca1c692'),
