 ('146', '147', '3', '87', 'en_us', '3', '', '{\"typeId\":\"3\",\"authorId\":\"87\",\"title\":\"Victoria Ripepi\",\"slug\":\"victoria-ripepi\",\"postDate\":1446762360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"6\":\"<p>This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography.&nbsp;<\\/p><p>This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography.This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography.This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography.<br><\\/p><p>This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography.This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography. This is Victoria\'s biography.<br><\\/p>\",\"77\":\"\",\"4\":\"vripepi@ideabasekent.com\",\"7\":\"I own 64 pairs of shoes.\",\"26\":[\"6\"],\"3\":\"Event Coordinator\",\"5\":\"N\\/A\",\"27\":[\"178\"],\"89\":\"\"}}', '2015-12-17 15:58:43', '2015-12-17 15:58:43', '019313f3-9fc5-4990-94a1-45b1799d6aea'),
 ('147', '132', '5', '87', 'en_us', '8', '', '{\"typeId\":\"5\",\"authorId\":\"87\",\"title\":\"Event Planning 101: Victoria Ripepi\",\"slug\":\"event-planning-101-victoria-ripepi\",\"postDate\":1446735900,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"60\":[\"147\"],\"11\":\"<p>Hello, my name is Victoria Ripepi. I am an Interpersonal Communications major who is currently on my 5th year victory lap, but I am set to graduate in May 2016. I am the new event coordinator at IdeaBase.<\\/p>\\r\\n\\r\\n<p>As long as I can remember, event planning has been an interest of mine. The first event I planned was in 3rd grade when my teacher asked me to help with a parent-teacher-open house. As a 3rd grader, I basically thought I was the coolest person in the world&hellip; even though all I really did was set out some flyers, cookies, and juice. But I have enjoyed event planning ever since!<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>I think I enjoy event planning because I am so organized, I like to fix problems, I work best under pressure, and I like the exciting\\/nervous feeling you get on the day of the event. A lot of times when I say I want to go into event planning after I graduate people automatically think I mean weddings, but that is not the case. I want to do open houses, launch parties, special-event parties and so on.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>Before working at IdeaBase, I interned in the Spring of 2015 for an awesome company called Rebecca Adele PR & Events. I learned so much about myself and event planning there. One major thing I learned was that I didn\\u2019t want to go into PR after I graduate (the other career path I considered) and event planning is really what I love and have a passion for.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>The owner, Becki, puts on over 10 art shows called the Avant-Garde Art & Craft Shows all throughout Northeast Ohio. There were over 100 vendors at each event and I helped personally put on 4 shows. I also helped in the launch of a new show line called Bump to Bows- A Mommy Boutique Show.<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>When it comes to IdeaBase, I actually heard about the agency through one of the managers, Kristin, who is a longtime-family friend. When she told me about IdeaBase it immediately sparked my interest, and when the opportunity for an event coordinator came up, I jumped at it. I really enjoy working here and have already learned so much! IdeaBase is such a fun, encouraging, and helpful work environment. Being new here, whenever I have a question or concern, they immediately do whatever possible to help me. I have also learned so much about what it means working at a design agency and how talented my co-workers are!<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>As for my personal life, in my free time you can probably find me outside (if it\\u2019s nice out), at a mall because I have a deep love for clothes and fashion or hanging out with my two cats. I travel at any opportunity I can; I hope to travel to all 50 states one day!<\\/p>\\r\\n\\r\\n\\r\\n\\r\\n<p>After graduation I hope to get a job out of state. I am Cleveland born and raised and Ohio will always be home, but I know I need to get out of here and explore more than just my bubble that is Ohio. I like to push myself to always try new things and take opportunities that push me outside my comfort zone because that\\u2019ll only make my comfort zone that much bigger.<\\/p>\",\"92\":[\"114\"],\"49\":\"\"}}', '2015-12-17 15:58:59', '2015-12-17 15:58:59', 'cf19b93f-bcba-4025-8e31-655b928833ff'),
